Ці шпалери з колекції «Botanica» від Marburg перетворять ваш дім на вишуканий оазис благополуччя та затишку. Дизайн має пишний мотив листя з красивим тисненням і відображає природність і чистоту ботанічного світу. Тут поєднується екзотичний шарм, колорит джунглів і природна ненав'язливість. Наші шпалери поставляються з однаковим номером партії. Ви знайдете номер партії на вкладиші, який додається до кожного рулону шпалер. Будь ласка, вказуйте номер партії при повторному замовленні шпалер, щоб уникнути відхилень у кольорі.

