Фарба для внутрішніх робіт, що легко наноситься та має високу покривну здатність. Фарба не стікає та швидко сохне, пофарбовану поверхню можна мити (клас 2 стійкості до мокрого стирання). Виріб не містить органічних розчинників, практично не має запаху. Колерується в гамі пастельних кольорів. Фарба відповідає вимогам екомаркування Європейського союзу. Продукт призначений для фарбування стель в житлових, офісних та громадських приміщеннях, а також для обробки стін приміщень, які не потребують високої стійкості до миття (наприклад, спальні).
Фасування: 1л;
Ступінь глянцю: Матовий;

